import AllRights from "../../assets/logo/all-rights-reserved.svg";

export default function Footer() {
  return (
    <footer className="footer">
      <div>
        <img
          className="footer__image"
          src={AllRights}
          alt="2021 ASGARD BEAUTY. ALL RIGHTS RESERVED."
        />
      </div>
    </footer>
  );
}
